description:
Under Blackpool Lights is the first official DVD released by The White Stripes.

The DVD consists of 26 tracks recorded at The Empress Ballroom at the Winter Gardens in the English seaside resort of Blackpool on January 27 and 28, 2004, and directed by Dick Carruthers.
 Among these tracks, there are some cover songs such as &quot;Take a Whiff on Me&quot; (Lead Belly), &quot;Outlaw Blues&quot; (Bob Dylan), &quot;Jack the Ripper&quot; (Screaming Lord Sutch), &quot;Jolene&quot; (Dolly Parton), &quot;Death Letter&quot; (Son House), &quot;Goin&apos; Back to Memphis&quot; (Soledad Brothers), and &quot;De Ballit of de Boll Weevil&quot; (Lead Belly).


